custom_css:
.frappe-card {

background: rgba( 221, 232, 241, 0.5 ) !important;
box-shadow: 0 3px 13px 0 rgba( 31, 38, 135, 0.37 );
backdrop-filter: blur( 2px );
-webkit-backdrop-filter: blur( 2px );
border-radius: 10px;
border: 1px solid rgba( 255, 255, 255, 0.18 );
}


.sidebar-column.col-sm-2.d-flex.flex-column.justify-content-between {
    
background: rgba( 255, 255, 255, 0 ) !important;
box-shadow: 0 8px 32px 0 rgba( 31, 38, 135, 0.37 );
backdrop-filter: blur( 2px );
-webkit-backdrop-filter: blur( 2px );
border-radius: 10px;
border: 1px solid rgba( 255, 255, 255, 0.18 );
 z-index: 1000;
 height: 100% !important;
/*position: fixed;*/
    
}

.sidebar-column.col-sm-2.d-flex.flex-column.justify-content-between a:active {
    background-color: #04AA6D;
    color: #cf1111;
}

.sidebar-column.col-sm-2.d-flex.flex-column.justify-content-between a:hover {
    color: #000000;
    background: rgb(255 255 255 / 50%);
   
    
}

.button.btn.btn-default.btn-sm.btn-attach {

background: rgba(255,255,255,0.5);
-webkit-backdrop-filter: blur(10px);
backdrop-filter: blur(10px);
border: 1px solid rgba(255,255,255,0.25);
    
    
    
}


.main-column.col-sm-10 {
    background: rosybrown;
}


.form-control {
    background: rgba( 221, 232, 241, 0.5 ) !important;
    box-shadow: 0 3px 13px 0 rgb(31 38 135 / 37%);
    backdrop-filter: blur( 2px );
    -webkit-backdrop-filter: blur( 2px );
    border-radius: 10px;
    border: 1px solid rgba( 255, 255, 255, 0.18 );
}
